import React from 'react';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import TodoList from './components/TodoList';

const Router = () => {
	return (
		<BrowserRouter>
			<Routes>
				<Route path='/' element={<TodoList />} />
			</Routes>
		</BrowserRouter>
	);
};

export default Router;
